        background-color: #f2f2f2;
      `;

      const TableHeaderCell = styled.th`
        border: 1px solid #ddd;
        padding: 8px;
      `;

      const TableRow = styled.tr`
        &:nth-child(even) {
          background-color: #f9f9f9;
        }
      `;

      const TableDataCell = styled.td`
        border: 1px solid #ddd;
        padding: 8px;
      `;
      return (
        <section id="Table" style={{flexDirection: 'row'}}>
        <Table style={{}}>
      <TableHeader>
        <TableRow>
          <TableHeaderCell>Model Name</TableHeaderCell>
          <TableHeaderCell>Prediction</TableHeaderCell>
          <TableHeaderCell>R2 Score</TableHeaderCell>
          <TableHeaderCell>MSE</TableHeaderCell>
          <TableHeaderCell>MAE</TableHeaderCell>
        </TableRow>
      </TableHeader>
      <tbody> 
        {res_data && 
          res_data.map((res) => {
          return(<TableRow>
            <TableDataCell>{res?.modal_name}</TableDataCell>
            <TableDataCell>{res?.prediction.toFixed(2)}</TableDataCell>
            <TableDataCell>{res?.R2Score.toFixed(2)}</TableDataCell>
            <TableDataCell>{res?.MSE.toFixed(2)}</TableDataCell>
            <TableDataCell>{res?.MAE.toFixed(2)}</TableDataCell>
